export const WorkStyle = {
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'
    },
    backgroundWork: {
        width: '100%',
        height: '100vh',
        position: 'absolute',
        zIndex: -1
    },
    arrow: {
        width: 22,
        height: 36,
    },
    touchArrow: {
        position: 'absolute',
        top: 26,
        left: 16
    },
    avatar: {
        top: 13,
        right: 19,
        width: 70,
        height: 70,
        position: 'absolute'
    },
    title: {
        position: 'absolute',
        top: 100,
        left: 16,
        fontFamily: 'Ubuntu_500Medium',
        fontWeight: 'bold',
        color: '#fff',
        fontSize: 64
    },
    task: {
        position: 'absolute',
        top: 175,
        left: 16,
        fontFamily: 'Ubuntu_500Medium',
        fontWeight: 'bold',
        color: '#FFACE8',
        fontSize: 36
    },
    timer: {
        fontFamily: 'Ubuntu_500Medium',
        fontWeight: 'bold',
        color: '#B0D0FF',
        fontSize: 144
    },
    replay: {
        width: 71,
        height: 71,
    },
    touchPlay: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        position: 'absolute',
        bottom: 40
    }
}
